import React from "react";
import "./main-slide.scss";

function MainSlide() {
  return (
    <div className="main-slide-area">
      <div className="main-slide">
        <div className="slide-img">
            <img src="https://image.tmdb.org/t/p/original/3CxUndGhUcZdt1Zggjdb2HkLLQX.jpg" alt="movie" />
        </div>
        <div className="slide-infos">
            <h2 className="slide-title">Ant-Man and the Wasp: Quantumania</h2>
            <div className="slide-genres">
                <div className="genre-box">Action</div>
                <div className="genre-box">Comedy</div>
                <div className="genre-box">Fantastic</div>
            </div>
            <div className="slide-vote">
                <span>IMDb</span>
            </div>
        </div>

      </div>
    </div>
  );
}

export default MainSlide;
